import React, { Component } from 'react';
import Product from './Product';

class AllProducts extends Component{
	state = {
		'ids':[{'id':1},{'id':2},{'id':3},{'id':4},{'id':5}]
	}
	componenetDidMount(){
		axios.get('productHead').then(ref=>{
			this.setState(ref.data);
		}).catch(err=>{
			console.log(err);
		})
	}
	render(){
		return(
			<div className='cotainer'>
				{this.state.ids.map((d)=>{return(
					<div className='container' key={d.id}>	
						<Product
						ProductName='Goldy T-Shirt'
						Likes={d.id}
						Comments='2'
						Dislikes='0'
						onClick={()=>this.props.onClick(d.id)}
						/>
					</div>
				)})}
			</div>
		);
	}
}

export default AllProducts;
